import React, { Component } from 'react';
import styled from 'styled-components';

function ArticleCard({ linUrl }) {
	return (
		<ComponentWrapper>
			<a href={linUrl}>
				<div className="ExternalContentCard_ExternalContentCard__Thumbnail__H_YUA">
					<img
						src="https://image.wanted.co.kr/optimize?src=http%3A%2F%2Ft1.daumcdn.net%2Fbrunch%2Fservice%2Fuser%2F4BkI%2Fimage%2FtPY3S3sKQEPoSV1ILk5sa93eR_c&amp;w=500&amp;q=75"
						alt="[삼삼한] 목표, 3가지 키워드"
					/>
				</div>
			</a>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.li`
	display: flex;
	flex-direction: column;
	width: calc(25% - 20px);
	margin: 0 10px 50px;
`;

export default ArticleCard;
